(function() {
  var example, should;

  example = require('./example');

  should = require('should');

  describe('example', function() {
    return describe('helloWorld()', function() {
      return it('should return "Hello World!"', function() {
        return example.helloWorld__().should.be.equal('Hello World!');
      });
    });
  });

}).call(this);
